import { BrowserRouter } from "react-router-dom";
import Login from "./pages/login/login";
import Home from "./pages/home/home";
import { useState } from "react";
function App() {
  const [idAdmin, setAdmin] = useState(null);
  console.log(idAdmin);
  return (
    <div className="App">
      <BrowserRouter>
        {idAdmin ? <Home setAdmin={setAdmin} /> : <Login setAdmin={setAdmin} />}
      </BrowserRouter>
    </div>
  );
}

export default App;
